export const processMealTypes = (mealTypeString) => {
  return mealTypeString.split(',').map(type => type.trim());
};

export const renderStarsAndSoles = (starNumber, solesNumber) => {
  let stars = '';
  if (starNumber) stars = `${starNumber} Estrellas`;
  if (solesNumber) stars = `${solesNumber} Soles`;
  return stars;
};

export const getPriceSymbols = (price) => {
  if (price <= 20) return '€';
  if (price <= 40) return '€€';
  return '€€€';
};
